import { SEARCH_RESULT } from '../actionTypes'
import { combineReducers } from 'redux'
const defaultState = {
}

const matchResults =  (state = defaultState, action) => {
    switch(action.type){
        case SEARCH_RESULT: 
            return {
                ...state, 
               data: action.payload
            };
        default: 
            return state;
    }
}

export const rootReducer = combineReducers(
                    {matchResults}
                )
